import React, { useState, useEffect } from "react";
import "./Dashboard.css";
import Sidebar from "../comman/Sidebar";
import { getTotalUser } from "../../api";
function Dashboard() {
  const [totalUser, setTotalUser] = useState("");
  const [totalBlockUser, setTotalBlockUser] = useState("");
  const [totalActiveUser, setTotalActiveUser] = useState("");
  const handleTotalUserCount = async (event) => {
    try {
      const result = await getTotalUser();
      console.log(result);
      setTotalUser(result.allUserCount);
      setTotalBlockUser(result.blockedCount);
      setTotalActiveUser(result.activeCount);
    } catch (error) {
      console.error("Error registering user:", error);
    }
  };
  useEffect(() => {
    handleTotalUserCount();
  }, []);
  return (
    <>
      <body id="page-top">
        <div id="wrapper" className="row m-0">
          <div className="col-lg-2 col-xl-2 col-md-2 col-sm-2 p-0">
            <Sidebar style={{ width: "calc(100% - 2px)" }} />
          </div>
          <div className="col-lg-10 col-xl-10 col-md-10 col-sm-10 p-0 bg-white">
            <div id="content-wrapper" className="d-flex flex-column">
              <div id="content">
                <nav
                  className="navbar navbar-expand navbar-light bg-white topbar mb-4 static-top shadow"
                  style={{ height: "80px" }}
                >
                  <ul className="navbar-nav text-black">
                    <h4
                      className="ml-2"
                      style={{
                        fontFamily: "Poppins",
                        fontSize: "30px",
                        fontWeight: "400",
                      }}
                    >
                      Hello, Welcome to Funzy Dashboard
                    </h4>
                  </ul>
                </nav>
                <div className="container-fluid bg-white">
                  <div className="d-sm-flex align-items-center justify-content-between mb-4">
                    <h1
                      className="h5 mb-0 text-gray-800"
                      style={{
                        fontFamily: "Poppins",
                        fontSize: "25px",
                        fontWeight: "400",
                      }}
                    >
                      User Details
                    </h1>
                  </div>
                  <div className="row">
                    <div className="col-xl-9 col-md-6 mb-4">
                      <div className="card shadow h-100 py-2">
                        <div className="row">
                          <div className="col-xl-1 col-md-1 mb-2 mt-2 text-center">
                            {/* <div className="vertical-divider"></div> */}
                          </div>
                          <div className="col-xl-3 col-md-2 mb-2 mt-2 text-center">
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "25px",
                                fontWeight: "600",
                              }}
                            >
                              {totalUser}
                            </div>
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "18px",
                                fontWeight: "400",
                                color: "gray",
                              }}
                            >
                              Total No Of Users
                            </div>
                          </div>
                          <div className="col-xl-1 col-md-1 mb-2 mt-2 text-center">
                            <div className="vertical-divider"></div>
                          </div>

                          <div className="col-xl-3 col-md-3 mb-2 text-center mt-2">
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "25px",
                                fontWeight: "600",
                              }}
                            >
                              {totalActiveUser}
                            </div>
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "18px",
                                fontWeight: "400",
                                color: "gray",
                              }}
                            >
                              Active Users
                            </div>
                          </div>
                          <div className="col-xl-1 col-md-1 mb-2 mt-2 text-center">
                            <div className="vertical-divider"></div>
                          </div>
                          <div className="col-xl-3 col-md-3 mb-2 text-center mt-2">
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "25px",
                                fontWeight: "600",
                              }}
                            >
                              {totalBlockUser}
                            </div>
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "18px",
                                fontWeight: "400",
                                color: "gray",
                              }}
                            >
                              Blocked Users
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div className="d-sm-flex align-items-center justify-content-between mb-4">
                    <h1
                      className="h5 mb-0 text-gray-800"
                      style={{
                        fontFamily: "poppins",
                        fontSize: "25px",
                        fontWeight: "400",
                      }}
                    >
                      Earnings
                    </h1>
                  </div>
                  <div className="row">
                    <div className="col-xl-12 col-md-6 mb-4">
                      <div className="card shadow h-100 py-2">
                        <div className="row">
                          <div className="col-xl-1 col-md-4 mb-4 mt-2 text-center align-items-center">
                            {/* <div className="vertical-divider"></div> */}
                          </div>
                          <div className="col-xl-2 col-md-2 mb-2 mt-2 text-center">
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "25px",
                                fontWeight: "600",
                              }}
                            >
                              5K
                            </div>
                            <div
                              style={{
                                fontFamily: "Poppins",
                                fontSize: "18px",
                                fontWeight: "400",
                                color: "gray",
                              }}
                            >
                              Today Earning
                            </div>
